// src/App.js
import React from 'react';
import Header from './components/Header/Header';
import HeroSection from './components/HeroSection/HeroSection';
import Services from './components/Services/Services';
import './App.css';

function App() {
  return (
    <div className="App">
      <Header />
      <HeroSection />
      <Services />
      {/* Other components */}
    </div>
  );
}

export default App;
